import React from 'react'
import { Box, Container, Grid } from '@mui/material';

export const Logo = ({logo}) => {
  return (
    <Grid
            item 
            display={'flex'}
            direction={'column'}
            alignItems={'center'}
            alignContent={'center'}
            justifyContent={'center'}
            sx={{mt:5, mb:5, minWidth:'10vw',minHeight:'10vh',maxHeight:'100vh',maxWidth:'100vw'}}
        >
            <Box>
                <img src={logo} height={'auto'} width={'100%'} alt='logoUdeA'/>
            </Box>
    </Grid>
  
  )
}
